import React from "react";
import styles from '../elements_CSS/Footer.module.css' 
import logoG from '../../utils/logoG.png'
import logoL from '../../utils/logoL.png'

 export const Footer = ()=>{
    const style1 = {
        backgroundImage:`url(${logoG})`,
        backgroundRepeat: 'no-repeat',
        backgroundPosition: 'center',
        backgroundSize: 'cover',
        width:'2.5rem',
        height:'2.5rem'
    }
    const style = {
        backgroundImage:`url(${logoL})`,
        backgroundRepeat: 'no-repeat',
        backgroundPosition: 'center',
        backgroundSize: 'cover',
        width:'2.5rem',
        height:'2.5rem'
    }
    return(
        <footer className={style.container}>
            <h6  className={style.title}>created by Johan Cortes</h6>
            <div className={style.logo1} style={style1}></div>
            <div className={style.logo2} style={style}></div>
        </footer>
    )
}
